label("$30^{\circ}$",.4*dir(85),dir(175));
real t = (2/(sqrt(3)));
//draw(rightanglemark((1,.1),(1,0),(.9,0),s=3));
draw(rightanglemark(rotate(30)*(0,t**4),rotate(0)*(0,t**3),O,s=3));
draw(rightanglemark(rotate(0)*(0,t**3),rotate(-30)*(0,t**2),O,s=3));
//draw(rightanglemark(rotate(-30)*(0,t**2),rotate(-60)*(0,t**1),O,s=3));
[/asy]

solution:
First, we label the diagram as shown below:

[asy] size(170);
pair O; for(int i = 2; i < 5; ++i){
draw(O--((2/sqrt(3))^i)*dir(30*i));
}
for(int g = 2; g < 4; ++g){
draw( ((2/sqrt(3))^g)*dir(30*g)-- ((2/sqrt(3))^(g+1))*dir(30*g+30));
}
label("16 cm", O--(16/9)*dir(120), W);
//label("$30^{\circ}$",.4*dir(0),dir(90));
//label("$30^{\circ}$",.4*dir(25),dir(115));
label("$30^{\circ}$",.4*dir(50),dir(140));
label("$30^{\circ}$",.4*dir(85),dir(175));
real t = (2/(sqrt(3)));
label("$B$",(0,t**3),N);
label("$A$",rotate(30)*(0,t**4),NW);
label("$C$",rotate(-30)*(0,t*t),NE);
//label("$D$",rotate(-60)*(0,t),NE);
//label("$E$",(1,0),E);
label("$O$",O,S);
//draw(rightanglemark((1,.1),(1,0),(.9,0),s=3));
draw(rightanglemark(rotate(30)*(0,t**4),rotate(0)*(0,t**3),O,s=3));
draw(rightanglemark(rotate(0)*(0,t**3),rotate(-30)*(0,t**2),O,s=3));
//draw(rightanglemark(rotate(-30)*(0,t**2),rotate(-60)*(0,t**1),O,s=3));
[/asy]

Both right triangles are 30-60-90 triangles. Therefore, the length of the shorter leg in each triangle is half the hypotenuse, and the length of the longer leg is $\sqrt{3}$ times the length of the shorter leg.  We apply these facts to each triangle, starting with $\triangle AOB$ and working clockwise.

From $\triangle AOB$, we find $AB = AO/2 = 8$ and $BO = AB\sqrt{3}=8\sqrt{3}$.

From $\triangle BOC$, we find $BC = BO/2 =4\sqrt{3}$ and $CO = BC\sqrt{3} =4\sqrt{3}\cdot\sqrt{3} = \boxed{12}$.

problem:
What, in degrees, is the measure of the largest angle in $\triangle PQR?$

[asy]
draw((0,0)--(-1.3,4)--(7,0)--cycle);
label("$P$",(-1.3,4),NW); label("$Q$",(0,0),SW); label("$R$",(7,0),SE);

label("$6x^\circ$",(0,0),NE); label("$x^\circ$",(5,0),N); label("$3x^\circ$",(-.25,3));
[/asy]

solution:
Since the area of rectangle $PQRS$ is $24,$ let us assume that $PQ=6$ and $QR=4.$

Since $QT=TR,$ we have $QR=2QT$ so that $QT=2.$ [asy]
size(100);
draw((0,0)--(6,0)--(6,4)--(0,4)--cycle);
draw((0,4)--(6,2));
draw((5.8,1.1)--(6.2,1.1));
draw((5.8,.9)--(6.2,.9));
draw((5.8,3.1)--(6.2,3.1));
draw((5.8,2.9)--(6.2,2.9));
label("$P$",(0,4),NW);
label("$S$",(0,0),SW);
label("$R$",(6,0),SE);
label("$T$",(6,2),E);
label("$Q$",(6,4),NE);
label("6",(3,4),N);
label("2",(6,3),W);
label("2",(6,1),W);
[/asy] Therefore, triangle $PQT$ has base $PQ$ of length $6$ and height $QT$ of length $2,$ so has area $$\frac{1}{2}\cdot 6\cdot 2 = \frac{1}{2}\cdot 12 = 6.$$ So the area of quadrilateral $PTRS$ is equal to the area of rectangle $PQRS$ (which is $24$) minus the area of triangle $PQT$ (which is $6$), or $\boxed{18}.$

