solution:
We draw segment $\overline{CD}$ as shown parallel to lines $l$ and $k$.

[asy]
size(200); real h = 1.2; currentpen = fontsize(10pt);
draw(Label("$l$",Relative(1)),(0,0)--(1,0),E);
draw(Label("$k$",Relative(1)),(0,-h)--(1,-h),E);
