solution:
The first prime number is $2$ and we know that all prime numbers after that must be odd. $3$, $5$, and $7$ are prime because their only positive integer divisors are $1$ and themselves. $9$ is divisible by $3$ so it is not prime. $11$ and $13$ are prime, but $15$ is not because it is divisible by $3$ and $5$. Continuing, $17$ and $19$ are prime, but $21$ isn't because it is divisible by $3$ and $7$. Finally we know that $23$ is prime.

To sum these nine numbers quicker, we can group them so that they sum to multiples of $10$: \begin{align*}
2+ 3 + 5& + 7 + 11 + 13 + 17 + 19 + 23 \\
& = (3+7) + (11+19) + (13+17) + (23 + 5 + 2) \\
& = 10 + 30 + 30 + 30 \\
& = \boxed{100}
\end{align*}

Multiply  \[
3\text{ ballops}=11\text{ fallops}
\] by 10 to find that $30$ ballops are equal to $110$ fallops.  Then multiply  \[
6\text{ wallops} = 5\text{ ballops}
\] by 6 to find that $\boxed{36}$ wallops are equivalent to 30 ballops.

Raising 42 to powers could get really messy really quickly, so let's avoid substituting immediately, and see if there is a way to simplify the expression first.

Recall that $\left( \frac{1}{x} \right)^n=\frac{1}{x^n}$, so we can rewrite $\left(\frac{1}{a}\right)^4$ as $\frac{1}{a^4}$. Thus, we have  \[\frac{1}{a^4} \cdot 2 \cdot a^4+a^{2+1-3}.\]Because multiplication is commutative, we can rearrange the terms to get  \[2 \cdot \frac{1}{a^4} \cdot a^4+a^{2+1-3}.\]Any nonzero number times its reciprocal is 1, so this can be simplified to \[2 \cdot 1 +a^{2+1-3}.\]Simplifying the numbers in the exponent of $a$, we find that it simplifies to $a^0$. Because any number to the zero power is 1, this simplifies to 1. Thus, we have \begin{align*}
2 \cdot 1 +a^{2+1-3} &=2 + a^0 \\
&=2+1 \\
&=\boxed{3}.
\end{align*}

