solution:
In isosceles right triangle $\triangle ABC$ below, $\overline{AD}$ is the altitude to the hypotenuse.

[asy]
import olympiad;
unitsize(0.8inch);
pair A,B,C,D;
A = (0,1);
B= (1,0);
C = -B;
D = (0,0);
draw(A--B--C--A,linewidth(1));
draw(A--D,linewidth(0.8));
draw(rightanglemark(C,A,B,s=4));
draw(rightanglemark(C,D,A,s=4));
label("$A$",A,N);
label("$B$",B,S);
label("$C$",C,S);
label("$D$",D,S);
[/asy]

Because $\triangle ABC$ is an isosceles right triangle, $\angle ABC = 45^\circ$.  Since $\angle ADB = 90^\circ$, we know that $\angle DAB = 45^\circ$, so $\triangle ABD$ is also a 45-45-90 triangle.  Similarly, $\triangle ACD$ is a 45-45-90 triangle.  Therefore, $DA=DB = DC = 5$, so $BC = BD+DC = 10$, and  \[[ABC] = \frac{(AD)(BC)}{2} = \frac{(5)({10})}{2} = \boxed{25}.\]

Since $\overline{AB}\parallel\overline{CD}$, we have $\angle A+ \angle D = 180^\circ$.  Since $\angle A = 2\angle D$, we have $2\angle D + \angle D = 180^\circ$, so $3\angle D = 180^\circ$, which means $\angle D = 60^\circ$.  Therefore, $\angle A = 2\angle D = \boxed{120^\circ}$.

[asy]
pair A,B,C,D;

A = (0,0);
B = (1,0);
D = rotate(120)*(0.8,0);
C = intersectionpoint(D--(D + (40,0)), B--(B + (rotate(135)*(1,0))));
draw(A--B--C--D--A);
label("$A$",A,SW);
label("$B$", B,SE);
label("$C$",C,NE);
label("$D$",D,NW);
[/asy]

