draw((0,0.4)--(0.4,0.4)--(0.4,0));
[/asy] Therefore, triangle $ABC$ has a base of length $9$ and a height of length $4.$ Thus, the area of triangle $ABC$ is $$\frac{1}{2}bh = \frac{1}{2}(9)(4) = \frac{1}{2}(36) = \boxed{18}.$$

By the order of operations, we perform the multiplications before the additions and subtractions: \begin{align*}
9-8+7\times 6 +5-4\times 3+2-1 &= 9-8+42 +5-12 + 2 -1\\
&=1 + 42 +5-12 + 2-1\\
&=48-12 + 2 -1\\
&= 36 +1 = \boxed{37}.
\end{align*}

