There are 12 hours on a clock, so each hour mark is $360^\circ/12 = 30^\circ$ from its neighbors.  At 3:30, the minute hand points at the 6, while the hour hand is mid-way between the 3 and the 4.  Therefore, the hour hand is $\frac12\cdot 30^\circ = 15^\circ$ from the 4 on the clock, and there are $2\cdot 30^\circ = 60^\circ$ between the 4 and the 6 on the clock.  So, the hour and the minute hand are $15^\circ + 60^\circ =\boxed{75^\circ}$ apart.

We will locate the numbers on the number line.  $4.5$ goes half way between $4$ and $5$ because $0.5=\frac{5}{10}=\frac{1}{2}.$.

Note that $4.45$ goes half way between $4.4$ and $4.5$ because $$0.4=\frac{4}{10}=\frac{8}{20}, \ \ 0.5=\frac{5}{10}=\frac{10}{20}, \ \ \text{and} \ \ 0.45=\frac{9}{20}.$$Likewise, $0.45$ goes half way between $0.4$ and $0.5$ because $$0.4=\frac{4}{10}=\frac{8}{20}, \ \ 0.5=\frac{5}{10}=\frac{10}{20}, \ \ \text{and} \ \ 0.45=\frac{9}{20}.$$Finally, $0.54$ goes just a little bit less than halfway between $0.5$ and $0.6$ because $0.54$ is just a little bit smaller than $0.55,$ which is half way between $0.5$ and $0.6.$

Thus, we can plot all four numbers on the same number line as follows: [asy]
size(8cm); defaultpen(linewidth(0.7));
real eps=0.08; int k; int n=9;
draw((-0.5,0)--(5.5,0),Arrows(4.0));
for(k=0;k<=5;++k)

{

draw((k,-eps)--(k,eps));

label("$"+string(k)+"$",(k,0),2.5*S);

}
for(k=1;k<10;++k)

{

draw((k/10,-eps/2)--(k/10,eps/2));

draw((4+k/10,-eps/2)--(4+k/10,eps/2));

}
dot("4.5",(4.5,0),3*N,red);
dot("4.45",(4.45,0),3*S);
dot("0.45",(0.45,0),3*N,green);
dot("0.54",(0.54,0),3*S);
[/asy] Therefore, the sum of the smallest and the largest numbers is $4.5 + 0.45 = \boxed{4.95}.$

The sum of the angle measures of an octagon is $180(8-2) = 1080$ degrees, so each angle of a regular octagon measures $1080^\circ/8=135^\circ$.  Therefore, $\angle BCD= 135^\circ$, which means $\angle BCP = 180^\circ - \angle BCD = 45^\circ$.  Similarly, $\angle PAB = 45^\circ$.  Since $\angle ABC = 135^\circ$, the reflex angle at $B$ that is an interior angle of $ABCP$ has measure $360^\circ - 135^\circ = 225^\circ$.  The interior angles of quadrilateral $ABCP$ must sum to $360^\circ$, so we have  \begin{align*}
\angle P &= 360^\circ - \angle PAB - (\text{reflex }\angle B) - \angle BCP\\
&=360^\circ - 45^\circ - 225^\circ - 45^\circ = \boxed{45^\circ}.
\end{align*} [asy]
unitsize(0.6inch);
pair A,B,C,D,EE,F,G,H,P;

A = rotate(-67.5)*(1,0);
B = rotate(45)*A;
C=rotate(45)*B;
D = rotate(45)*C;
EE = rotate(45)*D;
F = rotate(45)*EE;
G = rotate(45)*F;
H = rotate(45)*G;

P = A + (rotate(-90)*(D-A));
draw (A--B--C--D--EE--F--G--H--A--P--C,linewidth(1));
label("$A$",A,S);
label("$B$",B,SE);
label("$C$",C,NE);
label("$D$",D,N);
label("$E$",EE,N);
label("$F$",F,W);
label("$G$",G,W);
label("$H$",H,S);
label("$P$",P,S);
[/asy]

Note that we also could have solved this problem by noticing that $\overline{FC}\parallel\overline{HA}$, so $\angle APD = \angle FCD$.  Since $\overline{CF}\parallel\overline {ED}$, we have $\angle FCD = 180^\circ - \angle CDE = 180^\circ - 135^\circ = 45^\circ$.

